def hammingDistance(a,b):
    hammingDistance = 0
    for i in xrange(0,len(a)):
        if a[i] != b[i]:
            hammingDistance += 1
    return hammingDistance

def approxPatternMatching(string,pattern,d):
    patternString = ""
    patternLength = len(pattern)
    for i in xrange(0,len(string)-patternLength):
        if hammingDistance(string[i:i+patternLength],pattern) <= d:
            patternString += str(i) + " "

    return patternString


